const Actors = {
    camera: {},
    control: {},
    light: {},
    renderer: {},
    scene: {},
};

class SceneCamera extends Xerxes.camera.perspective {

    constructor () {

        super();

        this.aspect = window.innerWidth / window.innerHeight;
        this.far = 2000;
        this.fov = 45;
        this.near = 0.01;

        this.position.set( 50, 80, 50 );

        this.updateProjection();

    }

    updateProjection () {

        this.aspect = window.innerWidth / window.innerHeight;
        this.updateProjectionMatrix();

    }

}

class SceneControls extends Xerxes.control.orbit {

    constructor ( object, domElement ) {

        super( object, domElement );

        // angling

        this.maxPolarAngle = Math.PI / 2;
        // this.minPolarAngle =  Math.PI / 2

        // damping (interia)

        this.enableDamping = true;
        this.dampingFactor = 0.05;

        // distancing

        this.maxDistance = 27.5;
        this.minDistance = 1;

        // panning

        this.panSpeed = 2;
        this.screenSpacePanning = false;

    }

}

class SceneLight extends Xerxes.light.directional {

    constructor ( color, intensity, parameters = {} ) {

        super( color, intensity );

        // add sun with shadow

        this.position.set( -50, 100, 50 ); // -1, 0.75, 1
        this.castShadow = true;
        this.shadow.mapSize.width = 2048 * 100;
        this.shadow.mapSize.height = 2048 * 100;
        this.shadow.camera.near = -2000;
        this.shadow.camera.far = 2000;
        this.shadow.camera.left = -100;
        this.shadow.camera.right = 100;
        this.shadow.camera.top = 100;
        this.shadow.camera.bottom = -100;

        this.target.position.set( 0, 0, 0 );

        if ( parameters.parent ) {

            parameters.parent.add( this );
            parameters.parent.add( this.target );

        }

    }

    update ( controlTarget ) {

        this.target.position.x = controlTarget.x;
        this.target.position.y = controlTarget.y;
        this.target.position.z = controlTarget.z;

        this.position.set(
            controlTarget.x + -50,
            controlTarget.y + 100,
            controlTarget.z + 50
        );

    }

}

const defaults = {
    alpha: true,
    antialias: true
};

class SceneRenderer extends Xerxes.renderer.webgl {

    constructor ( parameters = defaults ) {

        super( parameters );

        this.outputEncoding = Xerxes.constant.encoding.srgb;
        this.shadowMap.enabled = true;

        this.setPixelRatio( window.devicePixelRatio );
        this.setSize( window.innerWidth, window.innerHeight );

        document.body.querySelector( 'page#rooms' ).appendChild( this.domElement );

    }

    resize () {

        this.setSize( window.innerWidth, window.innerHeight );

    }

}

function setupActors () {

    Actors.scene.main = new Xerxes.scene();

    Actors.camera.scene = new SceneCamera();

    Actors.renderer.scene = new SceneRenderer();

    Actors.control.scene = new SceneControls( Actors.camera.scene, Actors.renderer.scene.domElement );

}

function setupLighting () {

    // add hemisphere

    Actors.light.hemi = new Xerxes.light.hemisphere( 0xffffff, 0xffffff, 1 );
    Actors.light.hemi.position.set( 0, 500, 0 );

    Actors.scene.main.add( Actors.light.hemi );

    // add sun

    Actors.light.sun = new SceneLight( 0xffffff, 1, { parent: Actors.scene.main } );

}

function setupTestRoom () {

    return new Promise( ( resolve ) => {

        const loader = new Xerxes.loader.gltf();

        loader.load( 'client/assets/models/room-type-2.glb', ( model ) => {

            model.scene.children[ 0 ].material.side = Xerxes.constant.side.double;
            model.scene.children[ 0 ].material.needsUpdate = true;

            model.scene.children[ 0 ].castShadow = true;

            Actors.house = model.scene;

            Actors.scene.main.add( Actors.house );

            // add plane for shadows

            resolve();

        } );

    } )

}

class Settings {

    constructor () {

        this.page = {
            selected: document.body.querySelectorAll( 'tool-ui btn' )[ 0 ].id
        };

    }

}

const SiteSettings = new Settings();

function setPage ( pageId ) {

    return new Promise( ( resolve ) => {

        if ( pageId != 'home' ) {

            document.body.querySelector( `text-ui` ).style.animation = 'disappear 1s forwards';

            document.body.querySelector( `page#${ pageId }` ).style.animation = 'appear 1s forwards';

            SiteSettings.page.previous = `${ SiteSettings.page.selected }`;

            SiteSettings.page.selected = pageId;

        } else {

            document.body.querySelector( `page#${ SiteSettings.page.selected }` ).style.animation = 'disappear 1s forwards';

            document.body.querySelector( `text-ui` ).style.animation = 'appear 1s forwards';

            SiteSettings.page.previous = `${ SiteSettings.page.selected }`;

            SiteSettings.page.selected = pageId;

        }

        updatePageLabel( pageId );

        resolve();

    } )

}

function updatePageLabel ( pageId, color ) {

    return new Promise( ( resolve ) => {

        document.body.querySelector( 'tool-ui label' ).innerHTML = document.body.querySelector( `tool-ui btn#${ pageId }` ).getAttribute( 'label' );

        if ( color ) document.body.querySelector( 'tool-ui label' ).style.color = color;

        resolve();

    } )

}

function generateListeners () {

    const toolButtons = document.body.querySelectorAll( 'tool-ui btn' );

    console.log( toolButtons );

    for ( let i = 0; i < toolButtons.length; i++ ) {

        toolButtons[ i ].onclick = function ( e ) {

            setPage( this.id );

        };

        toolButtons[ i ].onmouseenter = function ( e ) {

            updatePageLabel( this.id, 'turquoise' );

        };

        toolButtons[ i ].onmouseleave = function ( e ) {

            updatePageLabel( SiteSettings.page.selected, 'white' );

        };

    }

}

class App extends Xerxes.app.default {

    constructor () {

        super();

        this.actors = Actors;

    }

    init () {

        setupActors();
        setupLighting();
        setupTestRoom();

        generateListeners();

        this.animateLogo();

        this.resize();
        // this.visualize()

    }

    update () {

        if ( Actors.camera.scene ) Actors.renderer.scene.render( Actors.scene.main, Actors.camera.scene );

        if( Actors.light.sun && Actors.control.scene ) Actors.light.sun.update( Actors.control.scene.target );

        if ( Object.keys( Actors.control ).length > 0 ) {

            for ( const c in Actors.control ) Actors.control[ c ].update();

        }

    }

    resize () {

        window.onresize = () => {

            if ( Actors.camera.scene ) Actors.camera.scene.updateProjection();
            if ( Actors.renderer.scene ) Actors.renderer.scene.resize();

        };

    }

    animateLogo () {

        setTimeout( () => {

            document.body.querySelector( 'text-ui' ).style.animation = 'recolor--ui 4s forwards';
            document.body.querySelector( 'text-ui content' ).style.animation = 'move-to-left--content 2s forwards';
            document.body.querySelector( 'text-ui content ul#title li' ).style.animation = 'move-to-left--text 4s forwards';
            document.body.querySelector( 'text-ui content hr#title' ).style.animation = 'move-to-left--hr 2s forwards';
            document.body.querySelector( 'text-ui content ul#loading li' ).style.animation = 'disappear--loading 2s forwards';
        
            const description = document.body.querySelectorAll( 'text-ui content ul#description li' );

            for ( let i = 0; i < description.length; i++ ) {
                description[ i ].style.animation = 'move-to-left--text 4s forwards';
            }

            setTimeout ( () => {

                document.body.querySelector( 'tool-ui' ).style.animation = 'tools-appear 2s forwards';

            }, 2000 );

        }, 1000 );

    }

}

window.app = new App( {
    useSRGBEncoding: true
} );

window.app.init();
